import React from 'react'; 
import { Link } from 'react-router-dom'; 
import facebook from './facebook.svg';
import instagram from './instagram.svg';
import linkedin from './linkedin.svg';


const Navbar = ({ balance }) => { 
    return ( 
        <nav className="navbar shadow-sm p-3 mb-5 bg-light rounded"> 
            <div className="container"> 
                <ul className="nav justify-content-cebter"> 
                    <li className="nav-item">
                    <img src={facebook} className="facebook" alt="facebook"  style={{width: '100%'}}/>
                    </li>
                    <li className="nav-item">
                    <img src={instagram} className="instagram" alt="instagram" style={{width: '100%'}}/>
                    </li>
                    <li className="nav-item">
                    <img src={linkedin} className="linkedin" alt="linkedin" style={{width: '10'}}/>
                    </li>
                    <ul class="nav justify-content-center">
  <li class="nav-item">
    <a class="nav-link active" aria-current="page" href="#">Active</a>
  </li>
  <li class="nav-item">
    <a class="nav-link" href="#">Link</a>
  </li>
  <li class="nav-item">
    <a class="nav-link" href="#">Link</a>
  </li>
  <li class="nav-item">
    <a class="nav-link disabled" aria-disabled="true">Disabled</a>
  </li>
</ul>
                </ul>
            </div>  
        </nav> 
        
    ); 
}; 

export default Navbar;
